(1, 1, '2019-03-14 23:55:25', '2019-03-14 23:55:25', '<!-- wp:paragraph -->\n<p>Default post type</p>\n<!-- /wp:paragraph -->', 'Test default post', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2019-03-15 00:49:57', '2019-03-15 00:49:57', '', 0, 'http://localhost:9000/?p=1', 0, 'post', '', 1),
(7, 1, '2019-03-15 00:01:47', '2019-03-15 00:01:47', '<!-- wp:paragraph -->\n<p>Here at Sydney Timber Solutions, we specialise in protecting and beautifying timber.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We love the<strong> natural look</strong> of timber; that it\'s a <strong>renewable resource</strong>; and that it can be maintained <strong>cost effectively</strong>. Most of all, we love helping our customers get the most out of their timber.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>With over 20 years experience in timber restoration and applications, we are experts in protecting timber and bringing out its natural beauty. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>We Specialise In</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li><strong>Pre-coating timber</strong> - so that it arrives onsite, pre-treated and ready to install.</li><li><strong>Restoring and maintaining timber</strong> in both residential and commercial settings. This includes decks, cladding on houses or buildings, public walk ways, and public space furniture such as park benches.</li></ul>\n<!-- /wp:list -->', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2019-04-24 21:34:01', '2019-04-24 21:34:01', '', 0, 'http://localhost:9000/?page_id=7', 0, 'page', '', 0),
(8, 1, '2019-03-15 00:01:47', '2019-03-15 00:01:47', '<!-- wp:paragraph -->\n<p>You think water moves fast? You should see ice. It moves like it has a mind. Like it knows it killed the world once and got a taste for murder. After the avalanche, it took us a week to climb out. Now, I don\'t know exactly when we turned on each other, but I know that seven of us survived the slide… and only five made it out. Now we took an oath, that I\'m breaking now. We said we\'d say it was the snow that killed the other two, but it wasn\'t. Nature is lethal but it doesn\'t hold a candle to man.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Look, just because I don\'t be givin\' no man a foot massage don\'t make it right for Marsellus to throw Antwone into a glass motherfuckin\' house, fuckin\' up the way the nigger talks. Motherfucker do that shit to me, he better paralyze my ass, \'cause I\'ll kill the motherfucker, know what I\'m sayin\'?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>My money\'s in that office, right? If she start giving me some bullshit about it ain\'t there, and we got to go someplace else and get it, I\'m gonna shoot you in the head then and there. Then I\'m gonna shoot that bitch in the kneecaps, find out where my goddamn money is. She gonna tell me too. Hey, look at me when I\'m talking to you, motherfucker. You listen: we go in there, and that nigga Winston or anybody else is in there, you the first motherfucker to get shot. You understand?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Well, the way they make shows is, they make one show. That show\'s called a pilot. Then they show that show to the people who make shows, and on the strength of that one show they decide if they\'re going to make more shows. Some pilots get picked and become television programs. Some don\'t, become nothing. She starred</p>\n<!-- /wp:paragraph -->', 'About', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2019-03-15 00:01:47', '2019-03-15 00:01:47', '', 7, 'http://localhost:9000/?p=8', 0, 'revision', '', 0),
(9, 1, '2019-03-15 00:02:06', '2019-03-15 00:02:06', '<!-- wp:paragraph -->\n<p><strong>You can find us at:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Unit 6, 25a Powers Road,<br>Seven Hills, NSW, 2147</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>m:</strong> 0405 519 109<br><strong>e:</strong> info@sydneytimbersolutions.com.au  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3316.4405117889964!2d150.94819125068298!3d-33.77512088058749!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x6b129883a55f7103%3A0x875e0d015119d93!2s6%2F25A+Powers+Rd%2C+Seven+Hills+NSW+2147!5e0!3m2!1sen!2sau!4v1556000843751!5m2!1sen!2sau\" width=\"100%\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen=\"\"></iframe>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Contact', '', 'publish', 'closed', 'closed', '', 'contact', '', '', '2019-04-29 08:01:26', '2019-04-29 08:01:26', '', 0, 'http://localhost:9000/?page_id=9', 0, 'page', '', 0),
(10, 1, '2019-03-15 00:02:06', '2019-03-15 00:02:06', '<!-- wp:paragraph -->\n<p>You think water moves fast? You should see ice. It moves like it has a mind. Like it knows it killed the world once and got a taste for murder. After the avalanche, it took us a week to climb out. Now, I don\'t know exactly when we turned on each other, but I know that seven of us survived the slide… and only five made it out. Now we took an oath, that I\'m breaking now. We said we\'d say it was the snow that killed the other two, but it wasn\'t. Nature is lethal but it doesn\'t hold a candle to man.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Look, just because I don\'t be givin\' no man a foot massage don\'t make it right for Marsellus to throw Antwone into a glass motherfuckin\' house, fuckin\' up the way the nigger talks. Motherfucker do that shit to me, he better paralyze my ass, \'cause I\'ll kill the motherfucker, know what I\'m sayin\'?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>My money\'s in that office, right? If she start giving me some bullshit about it ain\'t there, and we got to go someplace else and get it, I\'m gonna shoot you in the head then and there. Then I\'m gonna shoot that bitch in the kneecaps, find out where my goddamn money is. She gonna tell me too. Hey, look at me when I\'m talking to you, motherfucker. You listen: we go in there, and that nigga Winston or anybody else is in there, you the first motherfucker to get shot. You understand?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Well, the way they make shows is, they make one show. That show\'s called a pilot. Then they show that show to the people who make shows, and on the strength of that one show they decide if they\'re going to make more shows. Some pilots get picked and become television programs. Some don\'t, become nothing. She starred</p>\n<!-- /wp:paragraph -->', 'Contact', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2019-03-15 00:02:06', '2019-03-15 00:02:06', '', 9, 'http://localhost:9000/?p=10', 0, 'revision', '', 0),
