s and space had a new lease of life.  </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Birds Nest, Chippendale</h4>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns has-2-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":167} -->\n<figure class=\"wp-block-image\"><img src=\"https://sydneytimbersolutions.com.au/wp-content/uploads/2019/04/The-Connection-1-1024x683.jpg\" alt=\"\" class=\"wp-image-167\"/><figcaption>The Connection, Rhodes</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":169} -->\n<figure class=\"wp-block-image\"><img src=\"https://sydneytimbersolutions.com.au/wp-content/uploads/2019/04/The-Connection-2-1.png\" alt=\"\" class=\"wp-image-169\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p><strong>The brief:</strong> To refresh all timber exteriors at this council event space.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>The work:</strong> We pressure washed all surfaces and applied two coats of Cutek Extreme.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>The outcome</strong>: The timbers and space had a new lease of life.  </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Our Work', '', 'publish', 'closed', 'closed', '', 'our-work', '', '', '2019-04-30 02:01:38', '2019-04-30 02:01:38', '', 0, 'http://localhost:9000/?page_id=18', 0, 'page', '', 0),
