(34, 1, '2019-03-15 00:38:25', '2019-03-15 00:38:25', '<!-- wp:paragraph -->\n<p>You think water moves fast? You should see ice. It moves like it has a mind. Like it knows it killed the world once and got a taste for murder. After the avalanche, it took us a week to climb out. Now, I don\'t know exactly when we turned on each other, but I know that seven of us survived the slide… and only five made it out. Now we took an oath, that I\'m breaking now. We said we\'d say it was the snow that killed the other two, but it wasn\'t. Nature is lethal but it doesn\'t hold a candle to man.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\n\nHere at Sydney Timber Solutions, we are passionate about the protection and beautification of timber.&nbsp;<br>In a nutshell, we love:<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>The natural look of timber</li><li>That timber is a renewable resource</li><li>That timber can be maintained cost effectively&nbsp;</li><li>Helping our customers maximise the lifespan of their timber</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>With over 20 years experience in timber restoration and applications, we are experts in making sure our Customers get the best out of their timber.&nbsp;\n\n</p>\n<!-- /wp:paragraph -->', 'About', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2019-03-15 00:38:25', '2019-03-15 00:38:25', '', 7, 'http://localhost:9000/?p=34', 0, 'revision', '', 0),
(35, 1, '2019-03-15 00:38:59', '2019-03-15 00:38:59', '<!-- wp:paragraph -->\n<p>You think water moves fast? You should see ice. It moves like it has a mind. Like it knows it killed the world once and got a taste for murder. After the avalanche, it took us a week to climb out. Now, I don\'t know exactly when we turned on each other, but I know that seven of us survived the slide… and only five made it out. Now we took an oath, that I\'m breaking now. We said we\'d say it was the snow that killed the other two, but it wasn\'t. Nature is lethal but it doesn\'t hold a candle to man.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\n\nHere at Sydney Timber Solutions, we are passionate about the protection and beautification of timber.&nbsp;<br>In a nutshell, we love:<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>The natural look of timber</li><li>That timber is a renewable resource</li><li>That timber can be maintained cost effectively&nbsp;</li><li>Helping our customers maximise the lifespan of their timber</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>With over 20 years experience in timber restoration and applications, we are experts in making sure our Customers get the best out of their timber.&nbsp;<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>We Specialise In</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Pre-coating timber - so that it arrives onsite, pre-treated and ready to use</li><li>Restoring and maintaining timber in both residential and commercial settings - e.g. decks, cladding on houses or buildings, public walk ways, and public space furniture such as park benches</li></ul>\n<!-- /wp:list -->', 'About', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2019-03-15 00:38:59', '2019-03-15 00:38:59', '', 7, 'http://localhost:9000/?p=35', 0, 'revision', '', 0),
