(44, 1, '2019-03-15 00:54:09', '2019-03-15 00:54:09', '<!-- wp:paragraph -->\n<p>Pre-coating is a great way of ensuring that all sides of your timber are protected prior to use.&nbsp;<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>How does it work?</strong></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Pieces of timber are fed through our pre-coating machine where your chosen application is first sprayed, before going through a series of brushes to ensure the coating is evenly dispersed. It is then stacked to allow absorption and diffusion.&nbsp;<br>Watch how we process a typical order<em>(links</em><em> to short video)</em><br>Get a quote or place an order <em>(link</em><em> to pricing calculator)</em></p>\n<!-- /wp:paragraph -->', 'Pre-Coating', 'Pre-coating is a great way of ensuring that all sides of your timber are protected prior to use. ', 'publish', 'closed', 'closed', '', 'pre-coating', '', '', '2019-03-16 03:37:42', '2019-03-16 03:37:42', '', 0, 'http://localhost:9000/?post_type=service&#038;p=44', 0, 'service', '', 0),
(45, 1, '2019-03-15 00:54:09', '2019-03-15 00:54:09', '<!-- wp:paragraph -->\n<p>Pre-coating is a great way of ensuring that all sides of your timber are protected prior to use.&nbsp;<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>How does it work?</strong></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Pieces of timber are fed through our pre-coating machine where your chosen application is first sprayed, before going through a series of brushes to ensure the coating is evenly dispersed. It is then stacked to allow absorption and diffusion.&nbsp;<br>Watch how we process a typical order<em>(links</em><em> to short video)</em><br>Get a quote or place an order <em>(link</em><em> to pricing calculator)</em></p>\n<!-- /wp:paragraph -->', 'Pre-Coating', '', 'inherit', 'closed', 'closed', '', '44-revision-v1', '', '', '2019-03-15 00:54:09', '2019-03-15 00:54:09', '', 44, 'http://localhost:9000/?p=45', 0, 'revision', '', 0),
(46, 1, '2019-03-15 00:54:36', '2019-03-15 00:54:36', '<!-- wp:paragraph -->\n<p> We are experts in rejuvenating timber decking, cladding and any other external timber surface.<br>Preparation is key, so much of our emphasis is on prepping the surfaces to ensure a great result.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br><strong>Cleaning</strong>Prior to any application, it is essential that the timber has been cleaned. Our team of professionals will thoroughly clean your timber surfaces to ensure a perfect end result.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br><strong>Sanding</strong>Where sanding is required, we use an industrial strength vacuum system to ensure dust is virtually eliminated.<br><strong>Oiling &amp; Staining</strong>Once the timber surfaces have been prepped, we apply your chosen finishes.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br>Upon completion, we do a complete clean and clear so you\'re ready to once again enjoy the beautiful rejuvenated look of your timber.<br>Check out our work </p>\n<!-- /wp:paragraph -->', 'Restoration & Maintenance', 'We are experts in rejuvenating timber decking, cladding and any other external timber surface.', 'publish', 'closed', 'closed', '', 'restoration-maintenance', '', '', '2019-03-16 05:49:32', '2019-03-16 05:49:32', '', 0, 'http://localhost:9000/?post_type=service&#038;p=46', 0, 'service', '', 0),
(47, 1, '2019-03-15 00:54:36', '2019-03-15 00:54:36', '<!-- wp:paragraph -->\n<p>\n\nWe are experts in rejuvenating timber decking, cladding and any other external timber surface.<br>Preparation is key, so much of our emphasis is on prepping the surfaces to ensure a great result.&nbsp;<br><strong>Cleaning</strong>Prior to any application, it is essential that the timber has been cleaned. Our team of professionals will thoroughly clean your timber surfaces to ensure a perfect end result.<br><strong>Sanding</strong>Where sanding is required, we use an industrial strength vacuum system to ensure dust is virtually eliminated.<br><strong>Oiling &amp; Staining</strong>Once the timber surfaces have been prepped, we apply your chosen finishes.&nbsp;<br>Upon completion, we do a complete clean and clear so you\'re ready to once again enjoy the beautiful rejuvenated look of your timber.<br>Check out our work\n\n</p>\n<!-- /wp:paragraph -->', 'Restoration & Maintenance', '', 'inherit', 'closed', 'closed', '', '46-revision-v1', '', '', '2019-03-15 00:54:36', '2019-03-15 00:54:36', '', 46, 'http://localhost:9000/?p=47', 0, 'revision', '', 0),
(48, 1, '2019-03-15 00:54:48', '2019-03-15 00:54:48', '<!-- wp:paragraph -->\n<p> We are experts in rejuvenating timber decking, cladding and any other external timber surface.<br>Preparation is key, so much of our emphasis is on prepping the surfaces to ensure a great result. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br><strong>Cleaning</strong>Prior to any application, it is essential that the timber has been cleaned. Our team of professionals will thoroughly clean your timber surfaces to ensure a perfect end result.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br><strong>Sanding</strong>Where sanding is required, we use an industrial strength vacuum system to ensure dust is virtually eliminated.<br><strong>Oiling &amp; Staining</strong>Once the timber surfaces have been prepped, we apply your chosen finishes. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br>Upon completion, we do a complete clean and clear so you\'re ready to once again enjoy the beautiful rejuvenated look of your timber.<br>Check out our work </p>\n<!-- /wp:paragraph -->', 'Restoration & Maintenance', '', 'inherit', 'closed', 'closed', '', '46-revision-v1', '', '', '2019-03-15 00:54:48', '2019-03-15 00:54:48', '', 46, 'http://localhost:9000/?p=48', 0, 'revision', '', 0),
(49, 1, '2019-03-15 00:55:15', '2019-03-15 00:55:15', '<!-- wp:paragraph -->\n<p>We are familiar with most timber coating products, with our product of choice being Cutek.&nbsp;<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>Why?</strong></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>Cutek highlights your timber’s natural grain and beauty</li><li>Cutek doesn’t crack, peel or flake</li><li>Cutek provides long term timber protection from moisture and reduces cupping, warping and splitting</li><li>Cutek is 100% Australian owned and operated and uses high-quality ingredients that stand up to extreme conditions</li><li>Cutek is perfect for pre-coating (in clear) and can be wet-stacked before construction</li><li>Cutek offer a broad and stylish range of colourtones</li><li>Cutek offers t<strong>he only tintable wood preservative product in Australia*</strong></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>* Cutek Wood Preservative is an oil-based wood stabiliser used for pre-treatment and remedial treatment of exterior wood in industrial and domestic situations. Cutek Wood Preservative coated wood resists damage caused by fungal decay, mould and termites. Cutek Wood Preservative also protects exterior woods from moisture, improving dimensional stability and minimising warping, cupping, and splitting.<br>For more information, visit www.cutek.com.au&nbsp;\n\n</p>\n<!-- /wp:paragraph -->', 'Cutek', 'We are familiar with most timber coating products, with our product of choice being Cutek. ', 'publish', 'closed', 'closed', '', 'cutek', '', '', '2019-03-16 06:16:30', '2019-03-16 06:16:30', '', 0, 'http://localhost:9000/?post_type=service&#038;p=49', 0, 'service', '', 0),
