(67, 1, '2019-03-16 03:14:55', '2019-03-16 03:14:55', '<!-- wp:paragraph -->\n<p> We are familiar with most timber coating products, with our product of choice being Cutek.  Why? Cutek highlights your timber’s natural grain and beauty Cutek doesn’t crack, peel or flake Cutek provides long term timber protection from moisture and reduces cupping, warping and splitting Cutek is 100% Australian owned and operated and uses high-quality ingredients </p>\n<!-- /wp:paragraph -->', 'Council Projects / Public Spaces', '', 'inherit', 'closed', 'closed', '', '51-revision-v1', '', '', '2019-03-16 03:14:55', '2019-03-16 03:14:55', '', 51, 'http://localhost:9000/?p=67', 0, 'revision', '', 0),
