(69, 1, '2019-03-16 03:36:38', '2019-03-16 03:36:38', '<!-- wp:paragraph -->\n<p>We are familiar with most timber coating products, with our product of choice being Cutek.&nbsp;<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>Why?</strong></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>Cutek highlights your timber’s natural grain and beauty</li><li>Cutek doesn’t crack, peel or flake</li><li>Cutek provides long term timber protection from moisture and reduces cupping, warping and splitting</li><li>Cutek is 100% Australian owned and operated and uses high-quality ingredients that stand up to extreme conditions</li><li>Cutek is perfect for pre-coating (in clear) and can be wet-stacked before construction</li><li>Cutek offer a broad and stylish range of colourtones</li><li>Cutek offers t<strong>he only tintable wood preservative product in Australia*</strong></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>* Cutek Wood Preservative is an oil-based wood stabiliser used for pre-treatment and remedial treatment of exterior wood in industrial and domestic situations. Cutek Wood Preservative coated wood resists damage caused by fungal decay, mould and termites. Cutek Wood Preservative also protects exterior woods from moisture, improving dimensional stability and minimising warping, cupping, and splitting.<br>For more information, visit www.cutek.com.au&nbsp;\n\n</p>\n<!-- /wp:paragraph -->', 'Cutek', 'We are familiar with most timber coating products, with our product of choice being Cutek. ', 'inherit', 'closed', 'closed', '', '49-revision-v1', '', '', '2019-03-16 03:36:38', '2019-03-16 03:36:38', '', 49, 'http://localhost:9000/?p=69', 0, 'revision', '', 0);
