(85, 1, '2019-03-25 22:03:28', '2019-03-25 22:03:28', '<!-- wp:paragraph -->\n<p> Here at Sydney Timber Solutions, we are passionate about the protection and beautification of timber.&nbsp;<br>In a nutshell, we love:<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li> The natural look of timber</li><li> That timber is a renewable resource </li><li> That timber can be maintained cost effectively </li><li> Helping our customers maximise the lifespan of their timber  <br></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[104,105,106,107,108]} -->\n<ul class=\"wp-block-gallery columns-3 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost:9000/wp-content/uploads/2019/03/adrien-olichon-1240768-unsplash-1-1024x683.jpg\" alt=\"\" data-id=\"104\" data-link=\"http://localhost:9000/?attachment_id=104\" class=\"wp-image-104\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost:9000/wp-content/uploads/2019/03/brooke-campbell-43862-unsplash-1-1024x683.jpg\" alt=\"\" data-id=\"105\" data-link=\"http://localhost:9000/?attachment_id=105\" class=\"wp-image-105\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost:9000/wp-content/uploads/2019/03/Ocean-Club_CD50_Colourtone-Sela-Brown_1-1-1024x534.jpg\" alt=\"\" data-id=\"106\" data-link=\"http://localhost:9000/?attachment_id=106\" class=\"wp-image-106\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost:9000/wp-content/uploads/2019/03/scott-webb-710047-unsplash-1-1024x719.jpg\" alt=\"\" data-id=\"107\" data-link=\"http://localhost:9000/?attachment_id=107\" class=\"wp-image-107\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost:9000/wp-content/uploads/2019/03/spencer-watson-327580-unsplash-1-1024x683.jpg\" alt=\"\" data-id=\"108\" data-link=\"http://localhost:9000/?attachment_id=108\" class=\"wp-im