(88, 1, '2019-03-25 22:03:59', '2019-03-25 22:03:59', '<!-- wp:paragraph -->\n<p>We are in the business of protecting timber and bringing out its natural beauty. So we work with people that care about this too. That includes;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><a href=\"https://sydneytimbersolutions.com.au/architects/\">Architects</a></li><li><a href=\"https://sydneytimbersolutions.com.au/building-construction/\">Builders</a></li><li><a href=\"https://sydneytimbersolutions.com.au/council/\">Councils and Government</a></li><li><a href=\"https://sydneytimbersolutions.com.au/timber-merchants/\">Timber Merchants </a></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Who we work with', '', 'publish', 'closed', 'closed', '', 'commercial-services', '', '', '2019-04-30 11:47:13', '2019-04-30 11:47:13', '', 0, 'http://localhost:9000/?page_id=88', 0, 'page', '', 0),
(89, 1, '2019-03-25 22:03:59', '2019-03-25 22:03:59', '<p><br /><br /><!--StartFragment--></p>\n\n<!-- wp:paragraph -->\n<p>\n\nHere at Sydney Timber Solutions, we are passionate about the protection and beautification of timber.&nbsp;<br>In a nutshell, we love:<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>The natural look of timber</li><li>That timber is a renewable resource</li><li>That timber can be maintained cost effectively&nbsp;</li><li>Helping our customers maximise the lifespan of their timber</li></ul>\n<!-- /wp:list -->\n\n<p><!--EndFragment--><br>\n<br>\n</p>', 'Commercial Services', '', 'inherit', 'closed', 'closed', '', '88-revision-v1', '', '', '2019-03-25 22:03:59', '2019-03-25 22:03:59', '', 88, 'http://localhost:9000/?p=89', 0, 'revision', '', 0),
