(93, 1, '2019-03-25 22:05:58', '2019-03-25 22:05:58', '<!-- wp:paragraph -->\n<p>Pre-coating is where timber is treated with your specified application, prior to installation. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Why pre-coat?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Pre-coating is a great way of ensuring that all sides of your timber are treated and protected prior to use. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Particularly for decking where moisture can be problematic, pre-coating provides an added level of protection for your (or your customers) investment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For building and construction, having the timber arrive onsite pre-treated, means it is protected from day one. It also means you\'re not wasting time or resources treating timber on site, or cleaning up the aftermath.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Pre-coating protects timber from...</h4>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Moisture</li><li>Cupping</li><li>Warping</li><li>Splitting</li><li>Checking</li><li>Rot</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>How does pre-coating work?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Pieces of timber are fed through our pre-coating machine where your chosen application is first sprayed, before going through a series of brushes to ensure the coating is evenly dispersed. It is then stacked to allow absorption and diffusion.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Product of choice</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Our product of choice is Cutek - a leader in the wood coating market. Unlike other coatings, Cutek works by diffusing deeply into the timber, rather than sitting on the surface. This unique penetrating oil provides ongoing protection from moisture and offers hassle-free maintenance.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Watch how we process a typical order</strong><em> (link to short video)</em><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Enquire about pricing or ordering</strong> <em>(link to pricing info)</em></p>\n<!-- /wp:paragraph -->', 'Pre-Coating', '', 'publish', 'closed', 'closed', '', 'pre-coating', '', '', '2019-04-25 03:27:47', '2019-04-25 03:27:47', '', 0, 'http://localhost:9000/?page_id=93', 0, 'page', '', 0),
(94, 1, '2019-03-25 22:05:58', '2019-03-25 22:05:58', '<p><br /><br /><!--StartFragment--></p>\n\n<!-- wp:paragraph -->\n<p>Pre-coating is a great way of ensuring that all sides of your timber are protected prior to use.&nbsp;<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>How does it work?</strong></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Pieces of timber are fed through our pre-coating machine where your chosen application is first sprayed, before going through a series of brushes to ensure the coating is evenly dispersed. It is then stacked to allow absorption and diffusion.&nbsp;<br>Watch how we process a typical order<em>(links</em><em> to short video)</em><br>Get a quote or place an order <em>(link</em><em> to pricing calculator)</em></p>\n<!-- /wp:paragraph -->\n\n<p><!--EndFragment--><br>\n<br>\n</p>', 'Pre-Coating', '', 'inherit', 'closed', 'closed', '', '93-revision-v1', '', '', '2019-03-25 22:05:58', '2019-03-25 22:05:58', '', 93, 'http://localhost:9000/?p=94', 0, 'revision', '', 0),
(95, 1, '2019-03-25 22:06:26', '2019-03-25 22:06:26', '<!-- wp:paragraph -->\n<p>At Sydney Timber Solutions we are experts in rejuvenating timber decking, cladding and any other external timber surface.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Preparation is key, so much of our emphasis is on preparing the surfaces to ensure a great result. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Typically, our process involves:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Cleaning</strong><br>Prior to any application, it is essential that the timber has been cleaned. Our team of professionals will thoroughly clean your timber surfaces to ensure a perfect end result.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Sanding</strong><br>Where sanding is required, we use an industrial strength vacuum system to ensure dust is virtually eliminated.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Oiling &amp; Staining</strong><br>Once the timber surfaces have been prepared, we apply your chosen finishes. Whilst we have worked with many brands over the years, our product of choice is <strong>Cutek</strong>. To find out more, click here (<em>link</em>). </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Upon completion</strong><br>We do a complete clean and clear so you’re ready to once again enjoy the beautiful rejuvenated look of your timber.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br><strong>PLEASE NOTE:</strong> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Due to a large number of current projects, we are not taking on any new residential restoration or maintenance work. If your requirements are not urgent or you still wish to enquire, please get in touch using the <a href=\"https://sydneytimbersolutions.com.au/contact/\"><strong>Contact Us</strong></a> form.  </p>\n<!-- /wp:paragraph -->', 'Restoration & Maintenance', '', 'publish', 'closed', 'closed', '', 'restoration-maintenance', '', '', '2019-04-25 11:03:47', '2019-04-25 11:03:47', '', 0, 'http://localhost:9000/?page_id=95', 0, 'page', '', 0),
(96, 1, '2019-03-25 22:06:26', '2019-03-25 22:06:26', '<!-- wp:heading {\"level\":1} -->\n<h1></h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We are experts in rejuvenating timber decking, cladding and any other external timber surface.<br>Preparation is key, so much of our emphasis is on prepping the surfaces to ensure a great result.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br><strong>Cleaning</strong>Prior to any application, it is essential that the timber has been cleaned. Our team of professionals will thoroughly clean your timber surfaces to ensure a perfect end result.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br><strong>Sanding</strong>Where sanding is required, we use an industrial strength vacuum system to ensure dust is virtually eliminated.<br><strong>Oiling &amp; Staining</strong>Once the timber surfaces have been prepped, we apply your chosen finishes.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br>Upon completion, we do a complete clean and clear so you’re ready to once again enjoy the beautiful rejuvenated look of your timber.<br>Check out our work</p>\n<!-- /wp:paragraph -->', 'Restoration & Maintenance', '', 'inherit', 'closed', 'closed', '', '95-revision-v1', '', '', '2019-03-25 22:06:26', '2019-03-25 22:06:26', '', 95, 'http://localhost:9000/?p=96', 0, 'revision', '', 0),
