(146, 2, '2019-04-24 21:44:57', '2019-04-24 21:44:57', '<!-- wp:paragraph -->\n<p>At Sydney Timber Solutions we are experts in rejuvenating timber decking, cladding and any other external timber surface.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Preparation is key, so much of our emphasis is on prepping the surfaces to ensure a great result. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Typically, our process involves:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Cleaning</strong><br>Prior to any application, it is essential that the timber has been cleaned. Our team of professionals will thoroughly clean your timber surfaces to ensure a perfect end result.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Sanding</strong><br>Where sanding is required, we use an industrial strength vacuum system to ensure dust is virtually eliminated.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Oiling &amp; Staining</strong><br>Once the timber surfaces have been prepped, we apply your chosen finishes.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Upon completion, we do a complete clean and clear so you’re ready to once again enjoy the beautiful rejuvenated look of your timber.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>View <strong>our work</strong>.</p>\n<!-- /wp:paragraph -->', 'Restoration & Maintenance', '', 'inherit', 'closed', 'closed', '', '95-revision-v1', '', '', '2019-04-24 21:44:57', '2019-04-24 21:44:57', '', 95, 'https://sydneytimbersolutions.com.au/95-revision-v1/', 0, 'revision', '', 0),
(147, 2, '2019-04-24 21:54:03', '2019-04-24 21:54:03', '<!-- wp:paragraph -->\n<p>For building and construction, pre-coating is a no brainer. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Your timber arrives onsite and pre-treated with the chosen application already applied.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When timber is pre-coated, all six sides of the timber are treated - which means the timber is fully protected from day one. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pre-coated timber also means you’re saving valuable time during the building process.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once pre-coated, timber can be installed straight away. And if your timber is sitting onsite for a while, you can rest easy knowing that it is protected from the elements. <br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Put simply, when your timber arrives pre-coated, it’s one less thing you have to worry about.</p>\n<!-- /wp:paragraph -->', 'Building & Construction', '', 'publish', 'closed', 'closed', '', 'building-construction', '', '', '2019-04-25 04:00:07', '2019-04-25 04:00:07', '', 0, 'https://sydneytimbersolutions.com.au/?page_id=147', 0, 'page', '', 0),
(148, 2, '2019-04-24 21:53:15', '2019-04-24 21:53:15', '<!-- wp:paragraph -->\n<p>For building and construction, pre-coating is a no brainer. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Your timber arrives onsite and pre-treated with the chosen application already applied. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When timber is pre-coated, all six sides of the timber are treated - which means the timber is fully protected from day one. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>It can be installed straight away or block stacked wet for later use - so if your timber is sitting onsite for a while, you don’t need to worry about it being damaged by the elements. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pre-coated timber also means you’re not wasting time treating the timber on site… or dealing with the mess that goes along with it!<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Put simply, when your timber arrives pre-coated, it’s one less thing you have to worry about.</p>\n<!-- /wp:paragraph -->', 'Building & Construction', '', 'inherit', 'closed', 'closed', '', '147-revision-v1', '', '', '2019-04-24 21:53:15', '2019-04-24 21:53:15', '', 147, 'https://sydneytimbersolutions.com.au/147-revision-v1/', 0, 'revision', '', 0),
