(150, 2, '2019-04-25 03:59:13', '2019-04-25 03:59:13', '<!-- wp:paragraph -->\n<p>For building and construction, pre-coating is a no brainer. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Your timber arrives onsite and pre-treated with the chosen application already applied.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When timber is pre-coated, all six sides of the timber are treated - which means the timber is fully protected from day one. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once pre-coated, timber can be installed straight away. And if your timber is sitting onsite for a while, you can rest easy knowing that it is protected from the elements. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pre-coated timber also means you’re saving valuable time during the building process. not wasting time treating the timber on site… or dealing with the mess that goes along with it!<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Put simply, when your timber arrives pre-coated, it’s one less thing you have to worry about.</p>\n<!-- /wp:paragraph -->', 'Building & Construction', '', 'inherit', 'closed', 'closed', '', '147-autosave-v1', '', '', '2019-04-25 03:59:13', '2019-04-25 03:59:13', '', 147, 'https://sydneytimbersolutions.com.au/147-autosave-v1/', 0, 'revision', '', 0),
(151, 2, '2019-04-25 03:07:38', '2019-04-25 03:07:38', '<!-- wp:paragraph -->\n<p>At Sydney Timber Solutions we are experts in rejuvenating timber decking, cladding and any other external timber surface.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Preparation is key, so much of our emphasis is on preparing the surfaces to ensure a great result. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Typically, our process involves:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Cleaning</strong><br>Prior to any application, it is essential that the timber has been cleaned. Our team of professionals will thoroughly clean your timber surfaces to ensure a perfect end result.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Sanding</strong><br>Where sanding is required, we use an industrial strength vacuum system to ensure dust is virtually eliminated.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Oiling &amp; Staining</strong><br>Once the timber surfaces have been prepared, we apply your chosen finishes. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Upon completion, we do a complete clean and clear so you’re ready to once again enjoy the beautiful rejuvenated look of your timber.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>View <strong>our work</strong>.</p>\n<!-- /wp:paragraph -->', 'Restoration & Maintenance', '', 'inherit', 'closed', 'closed', '', '95-revision-v1', '', '', '2019-04-25 03:07:38', '2019-04-25 03:07:38', '', 95, 'https://sydneytimbersolutions.com.au/95-revision-v1/', 0, 'revision', '', 0),
(152, 2, '2019-04-25 03:12:28', '2019-04-25 03:12:28', '<!-- wp:paragraph -->\n<p>At Sydney Timber Solutions we are experts in rejuvenating timber decking, cladding and any other external timber surface.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Preparation is key, so much of our emphasis is on preparing the surfaces to ensure a great result. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Typically, our process involves:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Cleaning</strong><br>Prior to any application, it is essential that the timber has been cleaned. Our team of professionals will thoroughly clean your timber surfaces to ensure a perfect end result.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Sanding</strong><br>Where sanding is required, we use an industrial strength vacuum system to ensure dust is virtually eliminated.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Oiling &amp; Staining</strong><br>Once the timber surfaces have been prepared, we apply your chosen finishes. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Whilst we have worked, and continue to work with many brands over the years, our product of choice is <strong>Cutek</strong>. To find out more, click here (<em>link</em>). </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Upon completion, we do a complete clean and clear so you’re ready to once again enjoy the beautiful rejuvenated look of your timber.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>View <strong>our work</strong>.</p>\n<!-- /wp:paragraph -->', 'Restoration & Maintenance', '', 'inherit', 'closed', 'closed', '', '95-revision-v1', '', '', '2019-04-25 03:12:28', '2019-04-25 03:12:28', '', 95, 'https://sydneytimbersolutions.com.au/95-revision-v1/', 0, 'revision', '', 0),
(153, 2, '2019-04-25 03:13:33', '2019-04-25 03:13:33', '<!-- wp:paragraph -->\n<p>At Sydney Timber Solutions we are experts in rejuvenating timber decking, cladding and any other external timber surface.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Preparation is key, so much of our emphasis is on preparing the surfaces to ensure a great result. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Typically, our process involves:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Cleaning</strong><br>Prior to any application, it is essential that the timber has been cleaned. Our team of professionals will thoroughly clean your timber surfaces to ensure a perfect end result.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Sanding</strong><br>Where sanding is required, we use an industrial strength vacuum system to ensure dust is virtually eliminated.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Oiling &amp; Staining</strong><br>Once the timber surfaces have been prepared, we apply your chosen finishes. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Whilst we have worked, and continue to work with many brands over the years, our product of choice is <strong>Cutek</strong>. To find out more, click here (<em>link</em>). </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Upon completion, we do a complete clean and clear so you’re ready to once again enjoy the beautiful rejuvenated look of your timber.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>View our work</strong><em> (link)</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Enquire here</strong><em> (link)</em></p>\n<!-- /wp:paragraph -->', 'Restoration & Maintenance', '', 'inherit', 'closed', 'closed', '', '95-revision-v1', '', '', '2019-04-25 03:13:33', '2019-04-25 03:13:33', '', 95, 'https://sydneytimbersolutions.com.au/95-revision-v1/', 0, 'revision', '', 0),
(155, 2, '2019-04-25 03:17:20', '2019-04-25 03:17:20', '<!-- wp:paragraph -->\n<p>Pre-coating is where timber is treated with your specified application, prior to installation. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Why pre-coat?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Pre-coating is a great way of ensuring that all sides of your timber are treated and protected prior to use. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Particularly for decking where moisture can be problematic, pre-coating provides an added level of protection for your (or your customers) investment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For building and construction, having the timber arrive onsite pre-treated, means it is protected from day one. It also means you\'re not wasting time or resources treating timber on site, or cleaning up the aftermath.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>How does pre-coating work?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Pieces of timber are fed through our pre-coating machine where your chosen application is first sprayed, before going through a series of brushes to ensure the coating is evenly dispersed. It is then stacked to allow absorption and diffusion.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Product of choice</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Our product of choice is Cutek - a leader in the wood coating market. Unlike other coatings, Cutek works by diffusing deeply into the timber, rather than sitting on the surface. This unique penetrating oil provides ongoing protection from moisture and offers hassle-free maintenance.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Watch how we process a typical order</strong><em> (link to short video)</em><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Enquire about pricing or ordering</strong> <em>(link to pricing info)</em></p>\n<!-- /wp:paragraph -->', 'Pre-Coating', '', 'inherit', 'closed', 'closed', '', '93-revision-v1', '', '', '2019-04-25 03:17:20', '2019-04-25 03:17:20', '', 93, 'https://sydneytimbersolutions.com.au/93-revision-v1/', 0, 'revision', '', 0);
