rs and space had a new lease of life.  </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Birds Nest, Chippendale</h4>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns has-2-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":167} -->\n<figure class=\"wp-block-image\"><img src=\"https://sydneytimbersolutions.com.au/wp-content/uploads/2019/04/The-Connection-1-1024x683.jpg\" alt=\"\" class=\"wp-image-167\"/><figcaption>The Connection, Rhodes</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":169} -->\n<figure class=\"wp-block-image\"><img src=\"https://sydneytimbersolutions.com.au/wp-content/uploads/2019/04/The-Connection-2-1.png\" alt=\"\" class=\"wp-image-169\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p><strong>The brief:</strong> To refresh all timber exteriors at this council event space.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>The work:</strong> We pressure washed all surfaces and applied two coats of Cutek Extreme.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>The outcome</strong>: The timbers and space had a new lease of life.  </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Our Work', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2019-04-25 10:42:10', '2019-04-25 10:42:10', '', 18, 'https://sydneytimbersolutions.com.au/18-revision-v1/', 0, 'revision', '', 0),
(176, 2, '2019-04-25 11:03:47', '2019-04-25 11:03:47', '<!-- wp:paragraph -->\n<p>At Sydney Timber Solutions we are experts in rejuvenating timber decking, cladding and any other external timber surface.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Preparation is key, so much of our emphasis is on preparing the surfaces to ensure a great result. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Typically, our process involves:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Cleaning</strong><br>Prior to any application, it is essential that the timber has been cleaned. Our team of professionals will thoroughly clean your timber surfaces to ensure a perfect end result.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Sanding</strong><br>Where sanding is required, we use an industrial strength vacuum system to ensure dust is virtually eliminated.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Oiling &amp; Staining</strong><br>Once the timber surfaces have been prepared, we apply your chosen finishes. Whilst we have worked with many brands over the years, our product of choice is <strong>Cutek</strong>. To find out more, click here (<em>link</em>). </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Upon completion</strong><br>We do a complete clean and clear so you’re ready to once again enjoy the beautiful rejuvenated look of your timber.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br><strong>PLEASE NOTE:</strong> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Due to a large number of current projects, we are not taking on any new residential restoration or maintenance work. If your requirements are not urgent or you still wish to enquire, please get in touch using the <a href=\"https://sydneytimbersolutions.com.au/contact/\"><strong>Contact Us</strong></a> form.  </p>\n<!-- /wp:paragraph -->', 'Restoration & Maintenance', '', 'inherit', 'closed', 'closed', '', '95-revision-v1', '', '', '2019-04-25 11:03:47', '2019-04-25 11:03:47', '', 95, 'https://sydneytimbersolutions.com.au/95-revision-v1/', 0, 'revision', '', 0),
(177, 1, '2019-04-29 02:54:11', '2019-04-29 02:54:11', '<!-- wp:paragraph -->\n<p> For architects, ensuring the best possible outcome for the client is everything. When working with timber, there are a huge range of species to choose from, and they are all unique in terms of how they respond to their environment. It is not just the architects job to specify the right timber so that it looks great when first installed - it is their job to make sure the timber will look great for a lifetime. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pre-coating ensures timber is protected from day one and beyond. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At Sydney Timber Solutions, our product of choice is Cutek, and that\'s for a few few reasons. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Cutek oil is unique in that it penetrates deep beneath the timber surface to protect from within. You can read more about this here <em>(link).</em></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>Cutek is 100% Australian manufactured and owned. They know our countries conditions, and have developed a product that responds to it. </li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>Cutek offer an extensive range of colourtones, so whatever the style, there will be a colourtone to suit. </li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Architects', '', 'publish', 'closed', 'closed', '', 'architects', '', '', '2019-04-30 02:57:43', '2019-04-30 02:57:43', '', 0, 'https://sydneytimbersolutions.com.au/?page_id=177', 0, 'page', '', 0),
