(203, 2, '2019-04-30 02:57:43', '2019-04-30 02:57:43', '<!-- wp:paragraph -->\n<p> For architects, ensuring the best possible outcome for the client is everything. When working with timber, there are a huge range of species to choose from, and they are all unique in terms of how they respond to their environment. It is not just the architects job to specify the right timber so that it looks great when first installed - it is their job to make sure the timber will look great for a lifetime. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pre-coating ensures timber is protected from day one and beyond. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At Sydney Timber Solutions, our product of choice is Cutek, and that\'s for a few few reasons. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Cutek oil is unique in that it penetrates deep beneath the timber surface to protect from within. You can read more about this here <em>(link).</em></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>Cutek is 100% Australian manufactured and owned. They know our countries conditions, and have developed a product that responds to it. </li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>Cutek offer an extensive range of colourtones, so whatever the style, there will be a colourtone to suit. </li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Architects', '', 'inherit', 'closed', 'closed', '', '177-revision-v1', '', '', '2019-04-30 02:57:43', '2019-04-30 02:57:43', '', 177, 'https://sydneytimbersolutions.com.au/177-revision-v1/', 0, 'revision', '', 0),
(205, 2, '2019-04-30 11:42:10', '2019-04-30 11:42:10', '<!-- wp:paragraph -->\n<p>We are in the business of protecting timber and bringing out its natural beauty. So we work with people that care about this too. That includes;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Architects</li><li>Builders</li><li>Councils and Government</li><li>Timber Merchants </li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Who we work with', '', 'inherit', 'closed', 'closed', '', '88-revision-v1', '', '', '2019-04-30 11:42:10', '2019-04-30 11:42:10', '', 88, 'https://sydneytimbersolutions.com.au/88-revision-v1/', 0, 'revision', '', 0),
